import styled from 'styled-components';

export const VendasDiv = styled.div`
  margin-left: 10rem;
  max-width: 100%;
  height: 100%;
  display: inline-block;
  @media(max-width: 1080px){
    margin: 0 auto;
    max-width: 100%;
    justify-content: center;
  }
`;

export const VendasText = styled.div`
  margin-bottom: 4rem;
  font-family: "Ubuntu";
  font-size: 3rem;
  font-weight: bold;
  color: #238d41;
`;
